import './App.css'
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom'

import React from 'react'
import TopMenu from '@component/TopMenu/TopMenu'
import MusicPage from '@component/Pages/MusicPage/Music'
import HomePage from '@component/Pages/HomePage/Home'
import AdminPage from '@component/Pages/AdminPage/Admin'

/*
[Front] ----->{Discord API} --->>


*/
// req.query.code
/*server.get('/auntification', (req, res) => {
	const code = req.query.code


	res.send('Авторизация успешна!')
})*/

function App() {
	return (
		<div>
			<TopMenu />
			<Routes>
				<Route path='/' element={<HomePage />} />
				<Route path='/music' element={<MusicPage />} />
				<Route path='/admin' element={<AdminPage />} />
				<Route path='/contact' element={<HomePage />} />
			</Routes>
		</div>
	)
}

export default App
